import React, { useState } from 'react'
import ReactDOM from 'react-dom'
import {Heading} from './heading.js'
import {Cpp_header} from './cpp.js'
import Add from './input.js'
import {Dsa_header} from './dsa.js'
import {Side_bar} from './side_bar.js'
import {Algorithms} from './algorithms.js'
import { Os_header } from './OS.js'
import { DBMS_header } from './DBMS.js'
import Cppimg from './cpp.png'
import javaimg from './java.png'
import dsimg from './ds.png'
import algoimg from './algorithms.png'
import Osimg from './Os.png'
import Dbmsimg from './Dbms.png'
import { Footer } from './footer.js'
import js_img from './js.png'
import { Js_header } from './JS.js'
import {React_header} from './react.js'
import Reactimg from './react.png'
import cnimg from './cn.png'
import htmlimg from './html.png'
import {Scroll_header} from './Scroll_bar.js'
import {Explore} from './Explore2.js'
import { Java_header } from './java.js'
import { Cn_header } from './cn.js'
import { Html_header } from './html.js'
import { Mocktest_header } from './Mocktest.js'
import './index.css'
import { Test_page } from './Test_page.js'
import { Authentication } from './Auth.js'
import { Apt_mockheader, Numerical_mockheader, Reasoning_mockheader,Cpp_mockheader } from './Aptitude.js'
import { address } from './Mocktest.js'
export let current_user={
    username:"ahethesham"
}
export class Main extends React.Component{
    constructor(props){
        super(props)
         this.state={user:{username:"ahethesham"},logged_in:this.props.logged_in}
         if(this.state.logged_in==false)
         {
         window.addEventListener('scroll',()=>{if(!this.state.logged_in)window.scrollTo(0,0)});
         }
    }

    render(){
        return(
            <>
            {!this.state.logged_in &&
                 <Authentication func={(user)=>{current_user=user;this.setState({user:user,logged_in:true},()=>{
                    let arr=Object.values(address)
                    for(let i=0;i<arr.length;i++)
                    arr[i].update()
                 })}}/>
             }
         <Heading />
         <Scroll_header />
         <Mocktest_header/>

         <Apt_mockheader  user={this.state.user}/>
         <Reasoning_mockheader user={this.state.user}/>
         <Numerical_mockheader user={this.state.user}/>
         <Cpp_mockheader user={this.state.user}/>
        <Side_bar arr={[['Data\nstructures',dsimg],['Cpp',Cppimg],['Java',javaimg],['DBMS',Dbmsimg],['Algorithms',algoimg],['OS',Osimg],['JavaScript',js_img],['React',Reactimg],['Networking',cnimg],['HTML',htmlimg]]}/>
        <div style={{height:'30px'}}></div>

        <Dsa_header/>
        <div style={{height:'40px'}}></div>
        <Algorithms/>
        <div style={{height:'40px'}}></div>
        <Cpp_header/>
        <Os_header/>
        <DBMS_header/>
        <Js_header/>
        <React_header/>
        <Java_header/>
        <Cn_header/>
        <Html_header/>
        <Footer/>

        </>       
         )
    }
}


export default class App extends React.Component{
  constructor(props){
    super(props)
    this.state={get:false,jobids:[],ind:-1,responsive_button:responsive_button()}
    this.update=this.update.bind(this)
    fetch(' https://hacker-news.firebaseio.com/v0/jobstories.json').then((res)=>res.json()).then((res)=>{this.setState({get:true,jobids:res,ind:0})})
    this.resize=this.resize.bind(this)
    window.addEventListener('resize',this.resize)
  }
  resize(){
    this.setState((prev)=>{
      return {
        get:prev.get,ind:prev.ind,jobids:prev.jobids,responsive_button:responsive_button()
      }
    })
  }
  update(){
      this.setState((prev)=>{return {get:true,ind:prev.ind,jobids:prev.jobids,responsive_button:prev.responsive_button}})
  }
  render(){
    return<div >
      <h1 style={{fontSize:`${Math.min(window.innerHeight/100,window.innerWidth/100)*4}px`,color:'orange'}}>Hacker News Jobs Board</h1>
    {this.state.get && <Job id={this.state.jobids[this.state.ind]}/>}
    {this.state.get&&this.state.ind+1<this.state.jobids.length && <Job id={this.state.jobids[this.state.ind+1]}/>}
    {this.state.get&&this.state.ind+2<this.state.jobids.length && <Job id={this.state.jobids[this.state.ind+2]}/>}
    {this.state.get&&this.state.ind+3<this.state.jobids.length && <Job id={this.state.jobids[this.state.ind+3]}/>}
    {this.state.get&&this.state.ind+4<this.state.jobids.length && <Job id={this.state.jobids[this.state.ind+4]}/>}
    {this.state.get&&this.state.ind+5<this.state.jobids.length && <Job id={this.state.jobids[this.state.ind+5]}/>}
    {this.state.ind+6<this.state.jobids.length&&
    <button style={this.state.responsive_button}onClick={()=>{this.setState((prev)=>{return {jobids:prev.jobids,get:false,ind:prev.ind+6}},this.update)}} >Load More Jobs</button>
     } 
    </div>
  }
}
class Job extends React.Component{
  constructor(props)
  {
    super(props)
    this.state={by:'',url:'',title:'',time:'',style:responsive_div()}
    fetch(`https://hacker-news.firebaseio.com/v0/item/${this.props.id}.json`).then((res)=>res.json()).then((res)=>{this.setState((prev)=>{return {by:res.by,url:res.url,title:res.title,time:res.time,style:prev.style}})})
    this.resize=this.resize.bind(this)
    window.addEventListener('resize',this.resize)
  }
  resize(){
    this.setState((prev)=>{
      return {by:prev.by,url:prev.url,titel:prev.title,time:prev.time,style:responsive_div()}
    })
  }
  render(){
    return<div style={this.state.style}>
      {!this.state.url&&
      <h1 style={{fontSize:`${Math.min(window.innerHeight/100,window.innerWidth/100)*2}px`}}>{this.state.title}</h1>
      }
      {this.state.url &&
      <a style={{fontSize:`${Math.min(window.innerHeight/100,window.innerWidth/100)*2}px`,color:"black",fontWeight:'bold'}}href={this.state.url}>{this.state.title}</a>
      }
      <br/><br/>
      By:{this.state.by}
      </div>
  }
}
function responsive_div(){
  let h=window.innerHeight/100,w=window.innerWidth/100;
  let style={
    position:'relative',
    margin:`${h*2}px`,
    width:`${60*w}px`,
    left:`${10*w}px`,
    fontSize:`${2*h}px`,
    border:`${0.1*h}px solid black`,
    backgroundColor:'white'
  }
  return style
}
function responsive_button(){
  let h=window.innerHeight/100,w=window.innerWidth/100
  let style={
    height:`${5*h}px`,
    width:`${30*w}px`,
    backgroundColor:'orange',
    color:'white',
    fontSize:`${2*h}px`,
    border:'black',
    left:`${25*w}px`,
    margin:`${2*h}px`,
    position:'relative'
  }
  return style
}
//ReactDOM.render(<Main logged_in={false}/>,document.getElementById('root'));
ReactDOM.render(<App/>,document.getElementById('root'))
